    "2016-07-27T22:22:47.953118",nt"name": "fluvial-processes-and-passive-rehabilitation-of-the-lisbon-bottom-side-channel-chute-lower",nt"isopen":
    false,nt"url": null,nt"notes": "This report discusses ecological benefits
    that can be achieved through alteration of riverine geomorphology using passive
    approaches. The future of the Lisbon Bottom side-channel chute and its physical
    and biological characteristics are not predictable with confidence. The fluvial
    processes that create physical habitat can require long time intervals, and the
    ultimate characteristics of the chute may not be apparent for decades. Continued
    monitoring and evaluation of the evolution of the Lisbon Bottom chute will be necessary
    to assess long-term ecological benefits of passive rehabilitation in this setting.",nt"license_title":
